(8, 'Matias Vazquez ', 'thematutes@hotmail.com', 'telefono', 3, '2014-05-24', '0000-00-00', 'Hola buenos dias queria pedirles un favor queria saber el telefono del CENTRO EMISION DE LICENCIAS DE CONDUCIR EN CATAMARCA porque neccesito el certificado de legalidad  porque me vine a vivir a bs as. Desde ya muchas gracias'),
