(10, 'Maira Ferrufino ', 'mferrufino@hotmail.com.ar', 'Contacto', 4, '2014-05-27', '0000-00-00', 'Hola buen dia necesito que si me pueden brindar algun nimero para poder comunicarme a la municipalidad con la Direccion de Contratacion xq el que figura en la pagina es imposible intentamos toda la maÃ±ana y no hubo casa muchas gracias. Maira de la Provincia de Sa juan '),
(11, 'alicia castro', 'alga_b@hotmail.com', 'queja', 4, '2014-05-27', '0000-00-00', 'quisiera saber que pasa con la limpieza y barrido publico ya que  lo que va del aÃ±o solo dos veces pasaron por mi cuadra los barrenderos y uno cumple con el pago del impuesto y resulta que cuando pasa el camion de basura no tienen la precaucion de levantar la basura que se cae de las bolsas cuando pasa y la basura esta dias y semanas y despues somos los vecinos  los que debemos limpiar la calle por la mugre que dejan'),
(12, 'Cira Andrea Galvan', 'cirandrea68@gmail.com', 'Desratizacion', 1, '2014-05-28', '0000-00-00', 'Buenos DÃ­as necesito saber si la municipalidad tiene algÃºn programa para la desratizaciÃ³n. Mi problema es que yo puedo limpiar y desinfectar pero en lo que respeta a la manzana donde vivo mis vecinos no lo hacen podrÃ¡n darme una soluciÃ³n. Mi domicilio es NeuquÃ©n 1436 BÂ° San RamÃ³n y ademÃ¡s hace mÃ¡s de seis meses frente a mi domicilio hay una rama colgada en los cables del alumbrado publico cuando fueron le pedimos que la retiren y aun sigue allÃ­. Atte. Cira A. Galvan'),
(14, 'silvia cabrera', 'siviadelccabrera08@yahoo.com.a', 'plaza  sto domingo', 2, '2014-06-02', '0000-00-00', 'los vecinos de villa parque norte necesitamos que la plazoleta sato domingo ubicada enla interseccion de la calle felix avellaneda entre lucas barrionuevo y luis pacheco sea refaccionada iluminada y refosterada y acondicionada para que sea un lugar de descanso y juegos de la multitud de niÃ±os de zona piso ya que no hay otra plaza en las cercanias. actualmente es oscura sirve de encuentro de gente de mal vivir y jovenes en uso de drogas.'),
(20, 'Miguel Angel TrÃ©spidi ', 'migueltrespidi@gmail.com', 'Solicitar copia ordenanza', 4, '2014-06-02', '0000-00-00', '\r\nEn nombre de la Junta de Historia y ArqueologÃ­a de Elena (CÃ³rdoba) solicito copia de la ordenanza mediante la cual se declara Edificio de InterÃ©s Municipal integrante del Patrimonio TurÃ­stico Cultural HistÃ³rico y ArquitectÃ³nico de la Capital de la Municipalidad del Valle de San Fernando de Catamarca a una construcciÃ³n ubicada en el centro de la ciudad. \r\n\r\nLa misma serÃ¡ un aporte necesario para proceder en la redacciÃ³n de un instrumento que declare en mismo sentido a la primer vivienda que se realizÃ³ en 1914 a dos aÃ±os de haber sido fundado el pueblo y que aÃºn permanece intacta a fin de protegerla y conservarla para la posteridad.\r\n\r\nQuedaremos muy agradecidos por una pronta y positiva respuesta.\r\nEn caso no poder Uds. responder les ruego no indiquen la reparticiÃ³n donde debemos requerirla.\r\n\r\nSaludo a Uds. muy atentamente. \r\nDr. Miguel Angel TrÃ©spidi. Presidente Junta de Historia de Elena '),
(21, 'Alejandro Diaz', 'alejandrod93@hotmail.com.ar', 'Consulta', 4, '2014-06-02', '0000-00-00', 'Hola somos estudiantes de la Carrera Lic en Cs Ambientales de la Universidad Nacional de Catamarca necesitamos informacion para la Catedra Ordenamiento Territorial sobre la cantidad de barrios creados en los ultimos diez aÃ±os al igual que la cantidad de calles existentes en la ciudad Capital.\r\nSin otro particular saludamos atentamente a una espera de una respuesta favorable.. muchas gracias.. saludos'),
(22, 'Oscar Sebastian Bustos', 'seba_bustos007@hotmail.com', 'Consulta', 4, '2014-06-03', '0000-00-00', 'Con el mayor respeto les escribo para plantear mi problema y buscar la posibilidad de alguna soluciÃ³n que hasta el momento no encontre. Tengo un terreno en el BÂº Norte mas precisamente en la Calle Polonia entre BÃ©lgica y HungrÃ­a lo compre en el aÃ±o 2011 tengo boleto de compra venta y actualmente lo estoy pagando. En este terreno es que ya llevamos varios meses construyendo nuestra casa familiar el problema que nos surge ahora es que al dirigirnos a la empresa de energia Ec. Sapem a realizar el trÃ¡mite de conexion nos dicen que no pueden hacerlo porque es una zona de loteo lo raro de todo es que ya hay mas de 8 vecinos en el mismo loteo y todos pudieron accerder a la conexion de energÃ­a dicen que hay una normativa que les impide conectar a terrenos pertenecientes a loteos. Ahi no termina lo nuestro nos dirigimos a la empresa que nos vendio el terreno y nos dicen que en el aÃ±o 2011 cuando nos vendieron el terreno estaba autorizado y no era necesario que contaran con los servicios de agua y energia. Ahora nuestra consulta es verdad lo que nos dicen las dos empresas que ordenanza hoy en dia no permite la conexion de luz a terrenos que pertenecen a loteos con quien debemos hablar para encontrar una respuesta o presentar nuestro reclamo Esperando obtener un mensaje favorable les dejo mis saludos.'),
(23, 'griselda soria', 'grisemi@arnet.com.ar', 'banda de varela', 4, '2014-06-04', '0000-00-00', 'SeÃ±or Intendente ojalÃ¡ pueda ayudar a concretar lo que dirÃ© a continuaciÃ³n vivo en Banda de Varela y la calle (al lado del SEPAVE) que ingresa al Barrio San JosÃ© estÃ¡ a oscuras reciÃ©n en abril encendiÃ³ un foco de la luz pÃºblica a mitad de la calle. Previamente llamÃ© al nÃºmero que sugiere la pÃ¡gina para el alumbrado pÃºblico y como no hay una persona fÃ­sica que atienda el reclamo seguÃ­ las instrucciones de la mÃ¡quina luego me fijÃ© en el organigrama de la Intendencia y le mandÃ© un correo electrÃ³nico al Secretario del Ã¡rea y nunca me respondiÃ³ pero debo agradecer que al menos un foco en una extensa cuadra enciende a veces.\r\n Las calles no tienen nombre y es un problema al momento de pedir un taxi explicar en un negocio para que lleven lo comprado o simplemente dar la direcciÃ³n del lugar en que vivimos.Hay tanta gente olvidada pero no menos valiente que el reconocido... .\r\nAtentamente. Lic. Griselda Soria'),
