(34, 'Molto Lascano Evangelina Celeste', 'evi_laweb@hotmail.com', 'Multa no correspondiente', 3, '2014-06-18', '0000-00-00', 'Vivo en la provincia de CÃ³rdoba. RecibÃ­ una multa de transito que no me corresponde y no tengo tiempo ni medios para ir a comparecer a esa provincia. Tengo un Volkswagen Vento 2.5 color AZUL y me enviaron una multa de un Volkswagen color GRIS. En una fecha en la que estaba en la provincia de cÃ³rdoba. Hace dos dÃ­as vendÃ­ el vehÃ­culo y ahÃ­ saltÃ³ la misma. Necesito que me faciliten un nÃºmero de telÃ©fono o mail para poder hacer este descargo sin necesidad de apersonarme a la entidad. Mi telÃ©fono es 0351155939555 y el numero de causa es 07779230. Muchas gracias'),
(35, 'ana Di Mari', 'anahi_1752@hotmail.com', 'Ruidos molestos', 1, '2014-06-21', '0000-00-00', 'Es de todos los fines de semanas los estudiantes universitarios que alquilan en la calle Almagro 426 fiestas privadas con mÃºsica alta  disturbios en la via pÃºblica borrachos gritos vomitan y orinan las veredas de los vecinos. En este momento estÃ¡n con la mÃºsica muy alta y maÃ±ana sabado trabajamos. hoy 21/06/1014 02.08 hs. desde las 22 hs estÃ¡n con los escÃ¡ndalos.'),
(36, 'Ortiz Ramon Armando', 'RAMON16901@hotmail.com', 'presentar cv', 4, '2014-06-22', '0000-00-00', 'Buen diasaludo a quien reciba este mensaje y me dirijo tb a quien correspondapara consultar en donde y de que manera puedo presentar mi CVpara poder ser tenido en cuenta para puestos de trabajo a los cuales yo califique. Soy tecnico superior en higiene y seguridad en el trabajorecibido y matriculadocon experiencia en obras de montaje y procesos productivosjoven y con ganas de progresarexcelente desempeÃ±o comunicacional debido a mis conocimientos adquiridos en la carrera de prof. de EGB 1y2 de la cual tambien estoy recibidovivo en la ciudad de san fernando del valle de cat pero soy oriundo de tucuman y estoy tratando de ofrecerles mis servicios. Si uds asi lo requieren podemos comunicarnos y escer una entrevista cuando uds lo requieranesperando una pronta respuesta me despido.\r\n\r\nP/D si no es esta el area a la cual debo dirigirmehacer el favor de decirme cual espara poder yo asi entregar mi cv.muchas gracias.\r\n\r\nORTIZ RAMON\r\nCEL 03834001582'),
(37, 'AMIRA LEGUIZAMON', 'amilegui@yahoo.com.ar', 'calles desastrosas', 4, '2014-06-23', '0000-00-00', 'Soy una vecina del Barrio Nueva Catamarca.Hace casi 15 aÃ±os que transito por las calles de la zona y todas son un verdadero desaste.Desde agosto  y a paso de turtuga se trabaja para reorganizar el transito lo que es POSITIVO .Me gustaria que se aceleren los trabajos Y SE COLOQUE ASFALTO  en las calles que aun no lo tienen previa revision de las caÃ±erias de la via publica que se rompen por todos lados.en esta zona EL AGUA ES LO PRIMERO que se pierde y rompe lo poco que se hace.'),
