(39, 'Arnaldo Omar Obregon', 'arnaldo_omar@hotmail.com', 'Ciudad corre', 4, '2014-06-24', '0000-00-00', 'Hola ante todo felicitarlos por la 2da maratÃ³n ciudad corre.Participe de la misma con alumnos de la E.N.E.T. NÂ° 1 fue una hermosa experiencia algunos hicieron caminatas otros competimos. Les pido la atenciÃ³n si es que hicieron la lista de clasificaciÃ³nme hagan llegar por correo o informen si la van a publicar nos quedo con los chicos la inquietud de ver cual fue nuestra ubicaciÃ³n. Los saludo muy atentamente\r\n                              Lic. Arnaldo Omar Obregon'),
(40, 'jacinto jaimez', 'jaimezjacinto@gmail.com', 'Colectivos Catamarca', 3, '2014-06-24', '0000-00-00', 'Hola estimado escribo este mail con el motivo de ofrecer nuestro servicio para llevar a cabo el desarrollo de una aplicaciÃ³n mÃ³vil para dispositivos con sistema operativo Android la cual contarÃ­a con todo los horarios y recorridos del transporte publico de la ciudad adicionando la posibilidad de guardar horarios y resolver la duda de las personas que no saben que colectivo tomar para ir de un punto A a un punto B de la ciudad.\r\nNosotros ya tenemos una aplicaciÃ³n funcionando en la ciudad de Rio Cuarto Cordoba.\r\n\r\nAquÃ­ esta el link de la app https//play.google.com/store/apps/detailsidorg.tecpro.colectivos\r\n\r\nDesde ya disculpe las molestias ocasionadas.\r\nSi estÃ¡n interesado no duden en contactarse.\r\nSaludos cordiales.\r\nJacinto.\r\n'),
