(46, 'EDITH TAPIA', 'edithgra7@hotmail.com', 'basura', 4, '2014-06-25', '0000-00-00', 'Buenas tardes. Mi mensaje va a quien corresponda para que por favor levanten limpien el area donde fue realizada la FIESTA DE LAS COMIDAS TIPICAS creo que asi se llamaba en el BÂ° San Antonio Sur. Yo vivo en el costado de ese lugar en el BÂ° M.Teresa de Calcuta. La verdad es un asco como quedo todo. Las chicas y chicos que trabajaron durante el espectaculo lo hicieron muy bien pero los perros y gatos callejeros se encargaron de revolver los contenedores y desparramaron no fue ningun camion a levantar la basura. Ahora van a tener que limpiar la avenida y la plaza. \r\nDesde ya muchisimas gracias'),
(47, 'ariel vergara', 'alondra.esmeralda.123@gmail.co', 'consulta de requisitos', 4, '2014-06-26', '0000-00-00', 'Buenos dias soy un joven de 27 aÃ±os oriundo de esta provincia estudie y me recibi de electromecanico y actualmente estudio la carrera de ingenieria mecanica lamenmente estoy desocupado y sin ningun ingreso economico. Tengo una beba a quien criar y alimentar y dada a esta situacion me atrevi a escribirles consultando como acceder a una beca municipal o un trabajo en su municipio. Por favor a donde m debo dirigir y con quien..muchas gracias desde ya. Lo saludo atte'),
