(90, 'Diego Santillan Iturres', 'diegosantillaniturres@hotmail.', 'Lomos de burro y puesto policial 24 horas', 4, '2014-08-05', '0000-00-00', 'SeÃ±or Intendente RaÃºl Jalil Mi solicitud como residente del Barrio El Jumeal y General Paz al igual que de los demÃ¡s vecinos de estos barrios  prÃ³ximos a la rotonda Martin de Guemes y plaza El Maestro es la urgente instalaciÃ³n previo a los ingresos a la rotonda sobre las avenidas BartolomÃ© de Castro Illia y Mariano Moreno Norte y Sur de lomos de burro tal cual lo hicieron sobre avenida Ocampo. SabrÃ¡ ud. que donde vivimos es una de las zonas mas inseguras o calientes (segÃºn la policÃ­a) de la ciudad en cuanto trÃ¡nsito y delincuencia. La zona estÃ¡ bien iluminada pero las maniobras de muchos conductores es en general temeraria respecto a la prioridad de paso del que gira sobre la rotonda hubo cientos de accidentes y no baja la estadÃ­stica de siniestros en el lugar. Asimismo la delincuencia se hace un picnic con la peatones que circulan por la zona a cualquier hora atracan a sus vÃ­ctimas con armas y con suma violencia e impunidad. SerÃ­a preventivo y disuasivo la presencia las 24 hs. de vigilancia con la instalaciÃ³n de una garita o algo similar con presencia de personal de seguridad y ademÃ¡s de cÃ¡maras. PodrÃ­a ubicarse sobre la misma rotonda con visiÃ³n de 360 grados. Se imaginarÃ¡ que como todos los habitante de este sector hemos sido vÃ­ctimas de delitos varias veces y estamos cansados y decepcionados. Desde ya gracias por la atenciÃ³n y pensando en la seguridad de todos esperamos pronta respuesta.      '),
