(109, 'Javier Funes', 'jfunes@orbiseguros.com.ar', 'Polizas Autos', 4, '2014-08-22', '0000-00-00', 'Estimados\r\nMe informan que para poder emitir polizas de seguros de autos domiciliados en la ciudad de Catamarca la cia aseguradora deberÃ­a inscribirse en la Municipalidad. Es por ello que les solicito me envien a la mayor brevedad posible la normativa vigente en la materia. Como aclaraciÃ³n adicional les informe que la comercializaciÃ³n del seguro lo hacemos mediante un productor/asesor matriculado no teniendo la empresa una agencia/sucursal en esa jurisdicciÃ³n.\r\nA la espera de una respuesta de vuestra parte los saludo atte.\r\nJavier Funes\r\np/Orbis Seguros S.A.\r\n'),
