(129, 'Teotista Silvia Nieva', 'morena.avi.princesa@gmail.com', 'UNA MAMA DESESPERADA', 4, '2014-09-13', '0000-00-00', 'SeÃ±or Intendente \r\n\r\nMi nombre es TEOTISTA SILVA NIEVA D.N.I. NÂ° 24.605.668 con domicilio en Barrio Policial 144 viviendas 2Â° etapa â€“ casa 60. Catamarca  Capital\r\nAnte todo pido disculpas por el atrevimiento que me tome al escribirle por este medio. Estoy atravesando una situaciÃ³n muy difÃ­cil con mi hija de 16 aÃ±os que a la fecha tiene 5 intento de suicidios y ahora comenzÃ³ a consumir marihuana. El Ãºltimo episodio fue el dÃ­a 17 de agosto pasado en el cual se corto los brazos teniendo un total de 15 puntos esto debido a que se encontraba bajo los efectos de la droga y el alcohol. Ese dÃ­a ingreso a las 6 de la maÃ±ana por la guardia del hospital San Juan Bautista estando allÃ­ internada durante 5 dÃ­as en la parte de salud mental. Le juro que lo que vivÃ­ ese domingo al verla toda cortada y drogada no se lo deseo a nadie. Al dÃ­a siguiente entro en una crisis por la cual tuvieron que atarla de pies y manos para que no se haga daÃ±o. Ella necesita AYUDA URGENTE y yo quiero salvarla no quiero tener que velarla en poco tiempo.\r\nEste problema se genero hace tres aÃ±os estando desde esa fecha en tratamiento mÃ©dico y psicolÃ³gico. Siendo atendida en un primer momento por mÃ©dicos del hospital de niÃ±os â€œEva PerÃ³nâ€ por la Lic. Mercedes Salado. En el hospital San Juan Bautista  fue atendida por el siquiatra Dr. Soni Brice y la Dra. Mirta Losso. Teniendo varios de intento de suicidio e internaciones en la penÃºltima y ultima con aislaciÃ³n. Por ser considerada un paciente de alto riesgo para sÃ­ misma. \r\nLos mÃ©dicos recomiendan internaciÃ³n en centro de rehabilitaciÃ³n para mejor tratamiento. Catamarca solo cuenta con atenciÃ³n ambulatoria. Por este motivo he buscado centros cercanos a la provincia encontrado al  centro de rehabilitaciÃ³n FAZENDA (un centro de recuperaciÃ³n de jÃ³venes con adicciones donde sin uso de medicamentos y a partir de la convivencia fraterna el trabajo hacen de ellos hombres nuevos capaces de insertarse en la sociedad y aceptar los desafÃ­os que Ã©sta les propone con un porcentaje de recuperaciÃ³n del 85 por ciento. ) ubicado en la Ciudad de Quilino en la argentina de estos centros hay tres uno en la Rioja y otro en TucumÃ¡n siendo estos para varones. \r\nPara la internaciÃ³n necesito 5.000 pesos y una cuota mensual de 2500 por el lapso de un aÃ±o. Para lo cual estoy realizando rifas para conseguir este dinero porque soy una mama (sola) con tres niÃ±as de 16 15 y 5 aÃ±os y al cuidado de mis padres de 88 y 75 aÃ±os. Con una situaciÃ³n econÃ³mica extrema puesto que a la fecha no tengo trabajo tampoco cobro la asignaciÃ³n universal por estar mis hijas a cargo de mi madre.  \r\nDebido a esta situaciÃ³n es que me acerco a usted en busca de una ayuda en la medida de sus posibilidades.  He recorrido los Ministerios y no he encontrado respuesta alguna toda ayuda o guÃ­a serÃ¡ bien recibida puesto que este problema me excede no tengo medios econÃ³micos para afrontarlo no cuenta la provincia con una instituciÃ³n que pueda ayudarnos. \r\nTengo toda la documentaciÃ³n que avala mis palabras y si usted estÃ¡ interesado en el tema con mucho gusto se la acerco. \r\nDesde ya muchas gracias le dejo mi nÃºmero telefÃ³nico 383 154902014 y quedo a la espera de su respuesta\r\n\r\nGracias por su tiempo y atenciÃ³n reciba mi respeto y consideraciÃ³n. \r\n\r\nTEO â€“ una mama desesperada\r\n'),
