(167, 'PEREZ JOSE SEBASTIAN', 'jsperezdiamante@gmail.com', 'CONTENEDORES DE BASURA', 4, '2014-10-16', '0000-00-00', 'Me dirijo por este medio para solicitar que roten el contenedor de basura ya que hace mas de un aÃ±o que esta en mi docimicilio y no es justo que solo mi familia tenga que soportar todo lo que implica tener un contenedor de basura( alacranes  ratas malos olores etc.) ya presente una nota hace varios meses le solicite en varias oportunidades al sr. que maneja el camion que mueve los contenedores sin obtener ninguna respuesta. Creo que es buena la opcion de los contenedores pero falta todavia respeto y educacion de los vecinos y ademas que rote en la cuadra la ubicacion por lo tanto no solo tenga que soportar una sola familia la ubicacion del contenedor.  Mi domicilio es Av. Guemes entre Maipu y junin. Espero por este medio obtener una repuesta favorable'),
