(178, 'maria tapia', 't_maria932@yahoo.com.ar', 'laguna del parque', 4, '2014-10-22', '0000-00-00', 'Es posible que deje la laguna para que paseen en mini lanchita como una atracciÃ³n turÃ­stica acorde al lugar y construyan bares y confiterias como un centro de esparcimiento familiar.\r\nSi construye un balneario deberÃ¡ tener en cuenta erl anÃ¡lisis del agua que sea apto para la vida humana. No se olvide que en CVatamarca sufrimos de falta de agua. No derrochemos usemos mejoremos lo que tenemos como una atracciÃ³n del paisaje. Por Favor Sr. Intendente tenga en cuenta mi humilde opiniÃ³n.\r\n Gracias.'),
