(187, 'GABRIELA  ALSINA', 'gabyalsina@hotmail.com', 'reclamo urgente', 4, '2014-11-04', '0000-00-00', 'sr. intendente hice mil reclamos en insp. gral. por un lavadero clandestino en plena via publica con derroche de agua aguas servidas se estacionan en contra mano se sientan 10 jÃ³venes  con bebidas lavan en el asfalto ocupan la vereda de varias casas tomaron la cuadra caseros entre correintes y santa fe reubiquelos los Ã±iÃ±os no pueden salir a la vereda no hay seguridad publica a la vuelta plantaron as sobre el cordon es tierra de nadie a cinco cuadras de la guemes la reinserciÃ³n no se logra vulnerando las normas las ordenanzas para lavaderos no solo los ex presidiarios votan y tienen derecho los demas tambien. si algo me sucede o a mis hijos o bienes es responsabilidad del municipio hice el reclamo nieva aguero gallardo dicen que ud. los autoriza a molestar a un barrio completo. le solicito tome medidas vivimos en un estado de derecho nos estan sitiando en las esquinas limpia vidrios lava motos lava autos no se puede decir pone un lavadero en tu casa y comprarle las maquinas si no tienen ni desague en la propia casa y cae todo a la vereda y el derecho de los niÃ±os. Apelo a su buen criterio de ultima que laven los  autos del municipio o deles un plan a ud le gustaria abrir la puerta de su casa y encontrar autos mal estacionado  diez tipos tomando y mojando todo que los cordones de la vereda esten llenos de tierra  etc. no hay que hacer a los demas lo que no nos gusta que nos hagan. los que trabajamos votamos ellos reciben de ud como lo hicieron del radicalismo no les importa nada. Aprovecho para saludarlo atentamente. '),
