(193, 'Ana Soria', 'agsoria_3@yahoo.com.ar', 'Perros callejeros', 1, '2014-11-12', '0000-00-00', 'Hoy a la tarde fui mordida por un perro en La Alameda cuando caminaba a las 18 hs. cuando me queje con el placero grande fue mi sorpresa al informarme que debo ser la persona nÂº 10 que es mordida por este perro  la culpa la tiene una seÃ±ora que va a darle de comer y el perro se pone agresivo y ataca.Me pregunto que pasara si algun dÃ­a muerde a un niÃ±o  es UN PELIGRO ESE ANIMAL. Son como 8 los perros que hay pero es este en particular mediano de color marron. Por favor espero que hagan algo. Llame al 0800 y la chica que me atendio me dio 2 celulares de zoonosis para hacer el reclamo y JAMAS me atendieron. Por eso recurro a este medio.\r\nAtte.\r\nAna Soria\r\nDNI 17.890.386\r\nDomicilio Avenida Colon 1003\r\n '),
