(195, 'Tania Bertuzzi', 'tania_bertuzzi@yahoo.com.ar', 'Calle Maria Soledad  V P Chacabuco', 4, '2014-11-13', '0000-00-00', 'Estimado\r\nHemos enviado notas formales mensajes vÃ­a red social hablado con funcionarios municipales etcetc y no hemos recibido una solucion solo excusas y mÃ¡s excusas.\r\nDesde principios de 2013 un grupo de vecinos de Villa Parque Chacabuco viene solicitando la apertura y sistematizaciÃ³n de la CalleProyecto Maria Soledad. A fines de 2013 firmamos un acuerdo con Ud. SeÃ±or Intendente en el cual los vecinos donamos parte de nuestras propiedades para la ejecuciÃ³n de la Calle. Luego de mucho peregrinar logramos que las maquinas aparecieran por el terreno y abrieran una picada pero que aÃºn dista enormemente de ser una calle. PodrÃ¡ ver las fotos en el facebook de planeamiento urbano si le caben dudas.\r\nMi familia comprÃ³ un terreno debidamente autorizado por el Municipio construimos nuestra vivienda con los planos tambiÃ©n aprobados por vuestro municipio y es el dÃ­a de hoy que tengo que entrar todos los dÃ­as a mi hogar por el lote del vecino que gentilmente (y no se por cuanto tiempo) me permite ingresar a MI HOGAR dado que el municipio luego de dos largo aÃ±os de gestiÃ³n aÃºn no nos escucha. SerÃ¡ porque somos vecinos de bien y no salimos a escra.....'),
(196, 'ana pastrana', 'pastranana@hotmail.com', 'ATENCIO DE MI BARRIO VILLA PARQUE CHACABUCO', 4, '2014-11-17', '0000-00-00', 'SENOR INTENDENTE DON RAUL JALIL por favor le ruego incluya a VILLA PARQUE CHACABUCO entre los barrios a mejorar. MI domicilio es correa robin 168 entre pineta y cuello. NO contamos con barrido de callesni contenedoressomos los vecinos d esta cuadra los que limpiamos a diario. la recoleccion de basura MUY BUEN SERVICIO. LA PLAZA es una mugre a  diario la recorro pasan  semanas enteras que nadie recoge la basura. los juegos con que cuenta una hamaca la otra esta rota y un subebaja que se  los coloco en la gestion de don arnoldo castillo oscura  lugar de encuentro de chicos que fuman mariahuana a la vista de todos. hay en la plaza una vieja que la dono vialidad en la epoca de don fadel que resulta un peligro para los niÃ±os. me ofrezco a colaborar en lo que sea necesario pero por favor recuerde que pertecemos a la CAPITAL. Gracias. ana pastrana cel 154650087'),
(197, 'Julio Veliz', 'julioveliz01@hotmail.com', 'DestrucciÃ³n parcial de mi vereda por parte de un cargador de la Municipalidad de la Capital', 4, '2014-11-17', '0000-00-00', 'Estimados\r\nEn el dÃ­a de la fecha aproximadamente a horas 19 un cargador pequeÃ±o y un camiÃ³n marca Mercedes Benz con el NÂ°16 en la caja ambos pertenecientes a la Municipalidad de la Capital que estaba cargando escombros en la vereda de un vecino seguramente por el peso del mismo me rompiÃ³ parte de mi vereda ante lo cual espere que terminen su trabajo para preguntarle quien arreglarÃ­a los daÃ±os la persona que aparentemente era encargada del operativo ignoraba completamente mi consulta y ante mi insistencia me dijo que lo denuncie que el no arreglaba nada en forma totalmente descortÃ©s.  Poseo fotos del camiÃ³n y la rotura provocada si son necesarias.   \r\nAtento lo expresado en el presente espero una soluciÃ³n al daÃ±o causado.\r\nAguardo vuestra respuesta\r\n\r\n                                                        Julio A. VÃ©liz\r\n                                                      DNI 11983355\r\n                                                     Avenida GÃ¼emes 387\r\n'),
