(201, 'Maria Varela', 'margaritaoporto@hotmail.com', 'ordenanza 29282013', 4, '2014-11-21', '0000-00-00', 'Sr. intendente con esta ordenanza que modifica la toma de medida de la linea municiapal para el impuesto inmobiliario municipal (ABL) ud. me excluyo del sistema tributario despues de 25 aÃ±os de aporte no puedo afrontar un aumento del 500porque de pagar 200 tengo que pagar practicamente 1000 no me que da claro cual es su gestion de inclusion social cuando pone en practica esta ordenanza y cinco meses despues manda una ley de emergencia socioeconomicacreo que corresponde una respuesta mas alla del estamos trabajando en su consulta la sra. Peralta eso es lo unico que sabe decir la consejal Herrera pretendio callarme la boca con un subsidio yo jamas  pedi eso el director de rentas me dijo que si no tenia la plata no era problema de el que no pague su gente trabaja de una manera muy rara en pos de la inclusion social esta maÃ±ana escuche en radio provincia decir al consejal Miranda que el es quien realizo la gran modificacion tributaria y que Ud.esta ahora recogiendo los frutos de ese trabajosupuestamente yo quede  en ese trabajo de su compaÃ±ero excluida del sistema tributario fui una mas del monton y mientras nos pongan el pie encima nos van a seguir dominando no gobernando espero no sea esa su gestion de gobierno espero una respuesta.Tampoco se como hacer paras llegar a una entrevista con Ud.ni por tel. ni personalmente recibo soluciones.Maria Varela.'),
(202, 'olga cedron', 'olgaviccedron@hotmail.com', 'infeccion x residuosmala hambietacion x obras inconclusas en la puerta de mi casa', 1, '2014-11-23', '0000-00-00', 'buenos dias gente. le cuento el motivo de mi queja hacia el municipio de catamarca. empezaron hacer un asfalto en frente de mi casa me cerraron la entrada con cordon no puedo salir  ni entrar la ambulancia que traslada a mi papa a rayos el no tiene suficiente movilidad. ni siquiera entran los remis. muy indignada.  tambien no entran el recolector  de residuos lo cual la gente tira y tira basura en la puerta de mi casa... el otro tema es que me rompieron el ceped  arbolitos  x que dicen que van hacer un circuito y ahi quedo hace un aÃ±o rompieron todo con maquinas  revolvieron la tierra no se puede  vivir con tierra y basural en la puerta de la casa.\r\ny para sumarle un vecino cerro la unica callecita para que entre la ambulancia con troncos y ramas.  una verguenza que no piensen en los demas. le spido x favor que me ayuden a resolver esta situacion tengo a mi papa muy emfermo el tiene dos cancer y la verdad es muy importante que la ambulancia lo venga a buscar en la puerta y la basura x favor que se lleven la mugre que dejaron  es epocas de bichos ratas se los pido x fa vor ayudenmen\r\n'),
(203, 'osvaldo juarez', 'hectorosvaldojuarez@gmail.com', 'sugerencias', 3, '2014-11-26', '0000-00-00', 'sres. de transito deseo expresar mi constante preocupacion como vecino en referencia al transito de avda. colon y gral. roca. mensualmente existen estadisticas de una cantidad apreciable de accidente de transito de todo tipo de vehiculo lo que nos deja sumamente preocupados por las altas velocidades que desarrollan los automovilistas. En consecuencia apelo al buen criterio para que se coloquen reductores metalicos de disminuciÃ³n de velocidad por ambos carriles a fin de detener apreciablemente los accidentes. Por otra parte los dias sabados cuando termina la feria de verduras y otras la avda. presenta un aspecto deplorable por la cantidad de basura suelta que dejan los propios vendedores como tambien los respondables del cmion recolector que no atinan a  cuidar esos detalles. Espero que las sugerencias sean tenidas en cuenta gracias. '),
