(259, 'Maria del V Echenique', 'mariadelvallee@hotmail.com', 'FINANCIACION DEL BID/ERRADICACION DE BASURALES', 4, '2015-01-21', '0000-00-00', '\r\nA partir de mayo el gobierno argentino implementarÃ¡ un programa de erradicaciÃ³n de basurales\r\n9 de Enero de 2015\r\n\r\n\r\nEl programa ha recibido una financiaciÃ³n del BID por 150 millones de dÃ³lares. Se buscarÃ¡ reducir los basurales a cielo abierto reemplazÃ¡ndolos por rellenos sanitarios. Varias ciudades participarÃ¡n del proyecto que deberÃ­a beneficiar unos 3 millones de habitantes. Se reducirÃ¡ asÃ­ la exposiciÃ³n a enfermedades vinculadas con el mal manejo de los residuos.\r\n\r\nLa Argentina obtuvo fondos para implementar en 2015 el â€œPrograma de gestiÃ³n integral de residuos sÃ³lidos urbanosâ€ que busca disminuir los basurales a cielo abierto y sustituirlos por rellenos sanitarios lo que beneficiarÃ¡ a unos 1.700 recicladores y 3 millones de habitantes precisaron desde la SecretarÃ­a de Ambiente.\r\n\r\nâ€œEl beneficio del proyecto es principalmente la mejora en la gestiÃ³n de residuos y la eliminaciÃ³n de basurales a cielo abierto lo que evita la contaminaciÃ³n de la tierra el aire y las napas de agua subterrÃ¡neas y cursos de agua cercanosâ€ explicÃ³ Paula Kees coordinadora del Programa de Proyectos con Financiamiento Externo para la SecretarÃ­a de Ambiente y Desarrollo Susten de la NaciÃ³n.\r\n\r\nKees quien apuntÃ³ que el proyecto comenzarÃ¡ a implementarse en mayo de 2015 detallÃ³ que la iniciativa se financiarÃ¡ con un prÃ©stamo del Banco Interamericano de Desarrollo por un total de 150 millones de dÃ³lares y que beneficiarÃ¡ a unos 1.700 recicladores y a alrededor de 3 millones de habitantes aunque aclarÃ³ que â€œla cantidad de hogares y personas es un valor estimado que depende de los municipios donde se realicen las obrasâ€.\r\n\r\nhttp//www.ciudadnueva.org.ar/areastematicas/ecologiayambiente/apartirdemayoelgobiernoargentinoimplementaraunprograma\r\n'),
