(279, 'Jorge ArgaÃ±araz', 'yorch03@hotmail.com', 'Solicitud', 2, '2015-02-11', '0000-00-00', 'Buen dÃ­a. Este mensaje es para solicitar que revisen los postes de luz del barrio Virgen Morenita (cercanÃ­as de Av.MÃ©xico y Av. Choya). Estamos pagando impuestos de ABL y no cumplen con los servicios. No funcionan los focos y de noche es peligroso circular. Hay postes que estÃ¡n en mal estado y quebrados sostenidos sÃ³lo por los cables (esto precisamente en calle Antonio JesÃºs Lobos frente a donde se encuentra el tinglado que pertenecÃ­a a la empresa 25 de Agosto). Es riesgoso para las personas que recorren esa calle. \r\nA todo esto cabe mencionar que las calles estÃ¡n en muy mal estado debido a que las lluvias cavaron la tierra e hicieron grandes zanjas.\r\nLos vecinos agradecerÃ­amos que intervinieran. Muchas gracias.'),
(280, 'RubÃ©n A. Mengarelli GÃ³mez', 'rmengax@hotmail.com', 'Felicitaciones y pedido', 4, '2015-02-11', '0000-00-00', 'Secretaria de Turismo Cultura y Deportes/ At.Prof. M. Sastre Collado.\r\nSomos un matrimonio de jubilados de CarcaraÃ±Ã¡ Pcia. de Sta. Fe. situada a la vera del rÃ­o del mismo nombre y a 50 Km de Rosario por la AU R9 a CÃ³rdoba.\r\nEn Mayo ppdo estuvimos en La Casa de la Puna. AhÃ­ visitamos los talleres y departimos con las/os artesanos. Vimos sus trabajos en exhibiciÃ³n y quedamos maravillados. Alumnas/os e instructoras respondieron con suma calidez nuestras consultas y consintieron alegremente que les tomaramos algunas fotitos. Asumimos el compromisos de hacÃ©rselas llegar.Luego almorzamos en el lugar y fuimos atendidos con igual gentileza e impecable atuendo y pulcritud personal.\r\nEn fin linda gente lindo lugar linda comida y magnÃ­fico el emprendimiento del PTA Nos sorprendiÃ³ una iniciativa cultural tan profunda y el acuerdo social que obtiene. Felicitaciones al Intendente Jalil y a Uds.sus colaboradores. Nos prometimos volver.. Y tal vez la vida nos lo permita... \r\nAhora el pedido p.f. denos un Mail donde enviarles las fotos a la gente del taller. Saludos y felicidades para todos\r\nMarÃ­a del Carmen D.I  (73) y RubÃ©n A. Mengarelli GÃ³mez (78)\r\n'),
