(357, 'Edith Tapia', 'edithgra7@hotmail.com', 'respuesta a un correo elect', 4, '2015-04-16', '0000-00-00', 'A quien corresponda me dirijo para hacerles saber que varias veces hice reclamos por medio de esta pag. el tema es que siempre me mandaron a mi correo electronico y me dicen\r\nGracias por utilizar nuestro servicio de consultas. En breve nos contactaremos con usted.\r\nJAMASSSSSS SE COMUNICARON CONMIGO. NUNCA ME DIERON BOLA\r\nSON UNOS MENTIROSOS ASI LES VA A IR EN LAS URNAS'),
(358, 'Martin Caceres', 'martincaceres302@gmail.com', 'consulta', 4, '2015-04-17', '0000-00-00', 'Buenas noches mi nombre es Martin Caceres soy alumno universitario de la carrera de turismo de la Universidad Nacional del Nordeste situada en la Pcia de Corrientes mi consulta es que en el mes de noviembre tenemos pensado hacer un viaje con una catedra y debemos pasar una noche en su Ciudad y necesitamos informacion de algun albergue deportivo o universitario ya que somos todos estudiantes y este viaje no nos financia nadie lo pagamos cada uno de nuestro bolsillo y todo lo que podamos ahorrar bienvenodo sea nosotros estamos dispuestos a pagar pero no como el precio de un hotel de ser posible  esperamos poder contar con su ayuda\r\nSaludos cordiales desde la ciudad de Corrientes'),
