(362, 'vecino e L94/0548 vv nort', 'lauragonzalez@outlook.com', 'reclamo', 3, '2015-04-21', '0000-00-00', 'por favor a quien le competa TEREVINTOS Y  LA AGUADA hacia el norte a mitad de cuadra C/NÂº 47 hay taller mecanico que estaciona vehiculos q no andan en la calle y esto imposibilita el transito y el arreglo de la calle ya que cuando llueve es un rio. Al concejal Lopez Rodriguez Armando hagase cargo de arreglar calles del b 48 viviendas norte hace tres aÃ±os que esta y las calles siguen en pesimas condiciones y niiii hablar de un espacio verde. La plaza donde era uno de los monoblok le hicieron anos.canchita y fue y las plantas y los juegos y por lo menos denle forma de plaza. Concejal arregle las calles del barrio y acondicione espacios verdes y mande a sus inspectores a ver el tema del estacionamiento de vehiculos que interfieren el acceso a las viviendas ya van cinco denuncias que hicimos con los vecinos necesitamos mejoras en nuestro barrio y por sobre todo respeto como ciud'),
