(364, 'Daniela Caceres', 'daniela.caceres@vurkina.me', 'CONSULTA', 4, '2015-04-23', '0000-00-00', 'Buenos DÃ­as\r\na quien corresponda mi nombre es Daniela y soy de Buenos Aires el motivo de mi mail es primitivamente llegar a la persona que corresponda para mi pedido.\r\nLo que yo estarÃ­a necesitado es un permiso municipal para poder acciÃ³n especial de grafitis en las calles. Que seria esto seria bueno encontrar alguna pared en algÃºn lugar de la provincia mas bien cÃ©ntrica o de alto transito para que tenga mayor visibilidad que estÃ©n en mal estado o abandonadas. La idea es poder ayudar a la provincia a mejorar esas paredes que seguramente hay y muchas en la ciudad que no se ven de un gran modo y nosotros poder realizar la accion con nuestro cliente.\r\nDesde ya  muchas gracias pueden entrar en la pagina de nuestra agencia para ver un poco lo que hacemos en Bs As www.estoes.me \r\naguardo sus comentarios\r\nsaludos\r\n\r\n'),
(365, 'Nicolas Lupo', 'nicolas.lupo.86@gmail.com', 'Escultura bendecida por el Papa busca hogar en la Argentina', 4, '2015-04-23', '0000-00-00', 'Buenos tardes gentilmente paso a presentarme \r\n\r\nMi nombre es NicolÃ¡s Lupo le escribo desde Mar del Plata y colaboro en la Argentina con un reconocido escultor canadiense llamado Timothy Schmalz. \r\nTengo la intenciÃ³n de hacerle llegar una propuesta para que la Ciudad de Catamarca reciba a la mundialmente reconocida escultura de JesÃºs desamparado.\r\n\r\nEl valor real de esta obra de arte es transmitir un mensaje y darle longevidad al mismo.\r\n\r\nCreemos que la ciudad cuenta con diversos lugares que podrÃ­an ser un magnÃ­fico entorno para potenciar ese mensaje y simultÃ¡neamente aumentar su atractivo cultural y turÃ­stico al recibir una escultura de reconocimiento internacional bendecida por el mismo Papa Francisco.\r\n\r\nPor favor necesito que me brinden un mail (del Ã¡rea competente) donde pueda hacer llegar importante informaciÃ³n adicional al respecto.\r\n\r\nMuchas gracias'),
