(367, 'Cristina Asinari', 'crisasibell@hotmail.com', 'AGRADECIMIENTO Y PEDIDO', 4, '2015-04-25', '2012-10-22', 'Estimado RaÃºl Gracias .El mismo dÃ­a que les mande el mail volviendo de mi trabajo estaban las veredas sin yuyos y hoy me entero que han colocado cÃ¡maras en el barrio. No sabe lo importante y lo agradable que es recibir respuesta a un pedido en tiempos en los que nadie escucha.\r\nDe todos modos insisto INTIME A LOS PROPIETARIOS DE LOS TERRENOS BALDÃOS A TAPIAR Y LIMPIAR SUS LOTES. AsÃ­ lo hacÃ­an en la ciudad de CÃ³rdoba y si no cumplÃ­an lo hacÃ­a el muncipio les mandaba a cobrar el gasto y la multa y despuÃ©s a ejecutar. Le deseo Ã©xito en su gestiÃ³n y en la prÃ³xima que emprenda. Saludos cordiales Cristina Asinari  ');
