(374, 'Jonatan Emanuel Gimenez', 'jonatan_gimenez@live.com.ar', 'limpieza de terreno municipal y cambio de foco alumbrado publico', 2, '2015-05-01', '2012-10-07', 'Buenos dias le queria consultar que tengo que realizar para solicitar la limpieza de un terreno municipal que esta ubicado al lado de mi terreno que esta en construccion y los abaÃ±iles encontraron distintos tipos de alimaÃ±as. Otra consulta es sobre el cambio de un foco del alumbrado de la calle porque esta quemado. La matricula de mi terreno es 0725388926 y el terreno municipal esta ubicado del lado norte del mio. El foco quemado esta ubicado del lado este.\r\nPara ser mas preciso el terreno esta ubicado sobre calle espaÃ±a entre avenida los terevintos y los jacaranda. Sin otro motivo me despido.\r\n\r\nJonatan Emanuel Gimenez\r\nDNI32555080'),
