(379, 'Claudio Gambarella', 'lilavg77@hotmail.com', 'Limpieza de los CIC', 4, '2015-05-06', '2012-00-11', 'Hola me dirijo a ustedes a fin de solicitar algun contacto ya sea telefonico o por mail para reclamar sobre la limpieza del CIC sur resulta que en el CIC la encargada me comunica que es la municipalidad quien limpia y cuando lo hace tira y amontona toda la basura frente de mi dimicilio impidiendome entrar facilmente con mi vehiculo a mi domicilio resulta que hace mas de dos semanas estan limpiando el CIC y nadie levanta la basura anoche sin ir mas lejos  los bandalos existente en el BÂº 20 de marzo decidieron prenderle fuego a la basura y esto hizo que se quemen los arboles que con tanto sacrificio cuidamos tube que llamar a la policia y a los bomberos resulta que a estas horas 11.53 de la maÃ±ana del dia 06/05/15 estan tirando nuevamente  basura estoy cansado de reclamar estero me den una respuesta.'),
