(444, 'Veronica Bount', 'auxtralproducciones@hotmail.co', 'Al area de Cultura.', 4, '2015-06-17', '0000-00-00', 'A la seccion de Cultura del Municipio de San fernando.\r\n\r\nDesde Rio Cuarto  Musica Por la Paz \r\n\r\nBuenos Dias mi nombre es Veronica Bount escribo desde la productora Auxtral de Rio Cuarto Cordoba ya que yo y mi produccion estabamos intentando conseguir un contacto referido a cultura de vuestra  ciudad.\r\n\r\n Les comento rapidamente sobre la gira de nuestro guitarrista  instrumentista productor y gestor cultural Mario Cayon quien fuera el primer musico Argentino en tocar en las Islas Malvinas posee 6 discos como solista y hace 10 aÃ±os recorre el pais dictando clinicas y shows.\r\n\r\n Este aÃ±o comenzo una gira por nuestro pais tocando  y filmando en cada ciudad una parte del Himno Nacional Argentino a filmarse y editarse con una estrofa tocada en cada ciudad donde visita en su gira incluyendo Islas Malvinas.\r\n\r\n   Mario Cayon ademas fue  mencionado por el Soth Atlantic Concillium en su visita a Malvinas ante Naciones Unidas como el evento cultural integrador mas importante desde la post guerra hasta aqui.\r\n\r\n Ofrecemos un proyecto que incluye una la sobre su experiencia en Malvinas una clinica instrumental y la de produccion musical y autogestion y un show el mismo dia.\r\n\r\n Cualquier posibilidad de seguir conversando sobre vuestro interes estamos a vuestar disposicion.\r\n\r\nUn saludo Coordial.\r\n'),
