(521, 'roberto gomes', 'globalsolidarity.international', 'pedido de apoyo al Proyecto Eco Gobierno Planetario', 0, '2015-08-23', '0000-00-00', 'Hola estimado INTENDENTE Lic. RaÃºl Jalil\r\n        Te contactamos para pedirte tu apoyo personal al Proyecto de Eco Gobierno Planetario bajo Democracia Digital Directa Global con un presupuesto del 2 del PBI mundial para terminar con el hambre y el calentamiento global que serÃ¡ presentado ante la Cumbre de ParÃ­s COP 21 para ser tratado durante las deliberaciones de los mandatarios de casi 200 paÃ­ses.\r\nLa Legislatura de RÃ­o Negro y el HCD de Viedma Respaldan Totalmente el Proyecto.\r\nEL PRESIDENTE ENRIQUE PEÃ‘A NIETO (MX) ESTUDIA AVALAR NUESTRA INICIATIVA Y LAS AUTORIDADES SUIZAS ANALIZAN APOYAR EL FONDO SOLIDARIO DEL 2 DEL PBI.\r\n\r\nPETITORIO\r\n    Global Solidarity ha lanzado el siguiente petitorio para cambiar la inercia del cuadro de situaciÃ³n global\r\nâ€œQue los gobiernos del mundo logren un acuerdo global de reducciÃ³n de emisiones de efecto invernadero efectivo justo y vinculante acorde con las recomendaciones cientÃ­ficas de los informes IPCC que evite superar la barrera de  1 grado centÃ­grado y los presidentes del planeta aprueben y apliquen el Fondo Solidario del 2 del PBI para terminar con el hambre superpoblaciÃ³n y calentamiento global. Se instrumente la Democracia Digital Directa Global y se cree un Eco Gobierno Planetario.\r\n\r\nNUESTRA PROPUESTA\r\n\r\n    Eco Gobierno Planetario Naciones Unidas instrumentarÃ¡ mediante el sistema de Democracia Digital Directa un plebiscito para la creaciÃ³n de un Gobierno Planetario de coaliciÃ³n para cuya aprobaciÃ³n se contarÃ¡ con la votaciÃ³n del 50 mÃ¡s uno de los votos de todos los ciudadanos habilitados del mundo.\r\n    Tal gobierno centralizado tendrÃ¡ incumbencias en temas globales como el cambio climÃ¡tico las catÃ¡strofes medioambientales los recursos naturales vitales y estratÃ©gicos las enfermedades el hambre la pobreza extrema las guerras la trata de personas la defensa de los derechos humanos universales el combate al narcotrÃ¡fico y a la corrupciÃ³n.\r\n    ContarÃ¡ de un presupuesto equivalente al 2 del PBI mundial en forma anual. El presidente planetario tendrÃ¡ mandato durante 4 aÃ±os y podrÃ¡ ser reelecto para un segundo perÃ­odo. El Parlamento estarÃ¡ constituido por todos los ciudadanos del globo mediante Democracia Digital Directa asesorada mediante un Consejo de las Ciencias integrado por cientÃ­ficos.\r\n    El gobierno planetario tendrÃ¡ como misiÃ³n prioritaria erradicar el hambre la pobreza extrema ar la superpoblaciÃ³n y frenar el calentamiento global en lo inmediato.\r\n\r\nOBJETIVOS\r\nCon el 2 del PBI mundial en forma anual se podrÃ¡\r\n\r\n1. Abolir la pobreza extrema en toda la Tierra para siempre\r\n2. No morirÃ¡ mÃ¡s ningÃºn niÃ±o de hambre y por enfermedades evis.\r\n3. ReverdecerÃ¡n los bosques se plantarÃ¡n 20 mil millones de Ã¡rboles.\r\n4. Se renovarÃ¡ la tecnologÃ­a para dejar de contaminar.\r\n5. Se reemplazarÃ¡ el parque automotor por otro a hidrÃ³geno.\r\n6. Se desarrollarÃ¡n energÃ­as alternativas en reemplazo del petrÃ³leo y el carbÃ³n.\r\n7. Se descontaminarÃ¡n los ocÃ©anos.\r\n8. Se salvarÃ¡ Amazonia.\r\n9. Se arÃ¡ la superpoblaciÃ³n.\r\n10. HabrÃ¡ partidas para catÃ¡strofes medioambientales.\r\n11. Se combatirÃ¡ el terrorismo.\r\n12. Se combatirÃ¡ el narcotrÃ¡fico internacional.\r\n13. Se desarticularÃ¡ la criminalidad y la corrupciÃ³n organizada.\r\n14. Se preservarÃ¡n los ecosistemas.\r\n    Lideramos la Iniciativa del Fondo Solidario del 2 del PBI mundial en forma anual para terminar con el hambre mitigar la pobreza extrema ar la superpoblaciÃ³n y frenar el calentamiento global. Incluimos la propuesta de un Eco Gobierno Planetario de CoaliciÃ³n controlado mediante un sistema de Democracia Digital Directa. Para la cual solicitamos tu apoyo personal a esta causa.\r\n    No habrÃ¡ soluciones de fondo a los problemas globales sin fondos de capital intensivo. Este proyecto permite disponer de 500 mil millones de US para acudir en socorro de los 17.000 niÃ±os que mueren por dÃ­a de hambre y por falta de vacunaciÃ³n adecuada y de los 800 millones que pasan hambre asÃ­ como aliviar la pobreza extrema en todo el planeta iniciando una nueva era de Justicia Social en todo el orbe.\r\n    Tanto la ONU como la NASA en informes coincidentes vaticinan el colapso de nuestra civilizaciÃ³n para el 2050 a menos que cambie el sistema polÃ­tico y socioeconÃ³mico. No basta simplemente ar la emisiÃ³n de carbono. Hay que realizar una revoluciÃ³n sobre todo el mecanismo de producciÃ³n y consumo. Para esto se requieren fondos de capital intensivo. Es decir el 2 del PBI aportado por todos los paÃ­ses del globo para dar soluciÃ³n a los grandes flagelos comunes dado que los mismos ya se encuentran fuera de control y nos encontramos ante un panorama de â€œEmergencia Planetariaâ€.\r\n\r\nCUADRO DE SITUACIÃ“N\r\n    Durante el 2014 300 multimillonarios poseen 37 billones de dÃ³lares mÃ¡s que 3.500 millones de seres humanos que no superan entre todos los 22 billones de dÃ³lares.\r\n    SegÃºn UNICEF los que tienen menos se reparten sÃ³lo el 2 del PBI mundial.\r\n    De acuerdo con Oxfam Estados Unidos y la UE consumieron 92 billones de dÃ³lares por causa de la crisis de los crÃ©ditos tÃ³xicos financiando a los bancos. Con esos fondos el mundo no hubiera pasado hambre durante 300 aÃ±os.\r\n    Hoy el 1 de la poblaciÃ³n concentra el 50 del total de la riqueza mundial.\r\n\r\nÂ¿EMERGENCIA PLANETARIA\r\n\r\n    Evitar que la temperatura aumente mÃ¡s dos grados centÃ­grados no es suficiente concluyÃ³ el Dr. James Hansen experto en cambio climÃ¡tico y antiguo cientÃ­fico de la NASA. SegÃºn explica en su estudio publicado en la revista cientÃ­fica European Geoscience Union 1Âº grado mÃ¡s de calentamiento global puede ser catastrÃ³fico para la humanidad pues en solo 50 aÃ±os el nivel del mar aumentarÃ¡ 3 a 8 metros.\r\n    Este informe una vez cotejado y confirmado por la comunidad cientÃ­fica modifica el cuadro de situaciÃ³n respecto al cambio climÃ¡tico y nos ubica en situaciÃ³n de Emergencia Planetaria dado que nos encontramos prÃ³ximos a alcanzar 1Âº mÃ¡s de temperatura promedio global. De ahÃ­ la necesidad de extremar medidas de urgencia e intensivas como el Fondo Solidario del 2 del PBI mundial y el Eco Gobierno Planetario.\r\n\r\nCordialmente\r\nArq.\r\nRoberto F. Gomes\r\nwww.globalsolidarity.international\r\n'),
