(561, 'sergio', 'sergioance@hotmail.com', 'descargo y solicitar repuesta', 3, '2015-09-25', '0000-00-00', 'Adjunto el descargo que oportunamente presente en la direccion de transito y a la fecha no tuve repuesta (recibida el 23agosto Juzgado de falta Nro 2) codigo 4521							\r\n\r\n\r\nCatamarca 22 de agosto de 2015.\r\n\r\n\r\n\r\n\r\nAL SEÃ‘OR JUEZ DE FALTA\r\nMUNICIPALIDAD DE CATAMARCA CAPITAL\r\n\r\nTengo el agrado de dirigirme a Ud. En mi carÃ¡cter de titular del vehÃ­culo tipo camioneta dominio HNT 276 perteneciente al que suscribe Sergio VÃ­ctor Ance DNI 22.751.585 con domicilio en Av. San Martin S/N de la localidad de Bompland provincia de Corrientes en relaciÃ³n al Acta de ComprobaciÃ³n 60179 serie â€œDâ€ registro Municipalidad de la Capital de Catamarca â€“ Tribunal Municipal de Falta a los fines de presentar el descargo correspondiente.\r\n\r\n	Que el pasado 20 de agosto del presente aÃ±o siendo las 0800 Hs aproximadamente arribo a esta ciudad procedente de la provincia de Corrientes por Ã­ndole personal estacionando en la calle JunÃ­n a la altura del nÃºmero 1286.\r\n\r\n	Cuando estaba estacionando y bajando las pertenencias de mi flia que me acompaÃ±an se apersona en un principio un hombre diciendo que era policÃ­a y que habÃ­a llamado a la grÃºa para luego arribar al lugar uniformados de la direcciÃ³n de trÃ¡nsito aduciendo que no estaba permitido estacionar en el lugar.\r\n\r\n	Cabe precisar que en el lugar no existe ningÃºn cartel identificatorio que diga lo contrario o prohibiciÃ³n alguna.\r\n\r\n	Por lo expuesto les explique que realice el estacionamiento en el lugar por mi flia y que no veÃ­a prohibiciÃ³n de estacionar invocando de los inspectores que ese lugar era el de la doctora â€œsupuesta Jueza de un archivo provincial judicialâ€\r\n \r\n	Seguramente les pedÃ­ que me dejen bajar los bolsos y acomodar a mis cuatro (4) hijos que reciÃ©n llegaban en la casa de mi padre que tiene 90 aÃ±os y vive en la finca de la numeraciÃ³n mencionada procedentemente dÃ¡ndome una respuesta negativa amenazando que una grÃºa retirarÃ­a el vehÃ­culo si no acataba la orden de inmediato. Pese a que aduje es todo momento que entre mis progenitores se encontraba un hijo discapacitado (adjunto copia del Certificado de discapacidad).\r\n\r\n	Inmediatamente y pese a lo narrado confeccionan un acta de comprobaciÃ³n manifestando que era en base a una norma nacional y provincial sin explicarme una causa clara y justa que motiva la misma.\r\n\r\n	Por lo expuesto se hace notar que el acta resulta nula por los hechos inexistentes y falsos debido a que no existe falta alguna principalmente donde menciona el inspector â€œ6363â€ en el acta que dice.\r\n\r\n	â€œQue estacione en un lugar prohibidoâ€ mientras que el suscripto lo hizo en una calle que no posee ningÃºn tipo de prohibiciÃ³n o cartel indicador de ordenanza municipal.\r\n\r\n	Que dice que â€œdesconocÃ­ a la autoridadâ€ si solamente le pedÃ­ explicaciÃ³n donde estaba lo presuntamente prohibido y que me permitan un tiempo para trasladar a mis hijos y sus pertenencias mencionando nuevamente la situaciÃ³n de mi hijo discapacitado y la edad avanzada de mi padre teniendo una respuesta agresiva e inhumana contra mi persona y entorno.\r\n\r\n	Por ultimo menciona que me neguÃ© a firmar el acta de comprobaciÃ³n siendo todo lo contrario debido a que el suscripto querÃ­a firmar pero con la constancia que diga ausencia de cartel ni identificaciÃ³n municipal alguna de la prohibiciÃ³n que adujeron.\r\n\r\n	Conforme a lo expuesto concluyo que en ningÃºn momento me resistÃ­ ni transgredÃ­ norma laguna por lo tanto no se constatÃ³ falta alguna a las leyes de transito nacional y provincial.\r\n\r\n	Por lo expuesto solicito al seÃ±or Juez\r\nMe tenga presente  con domicilio y parte teniendo formulado el descargo del presente a los plazos legales.\r\nSe tenga por formulado el descargo por ofrecida las pruebas que se referencia a su\r\nSe tenga por planteada la nulidad del acta respectiva por los fundamentos expuestos.\r\nSe deje sin efecto el acta respectiva procediendo el archivo de la actuaciÃ³n\r\n\r\nDejando constancia de que similares notas serÃ¡n enviadas oportunamente a las distintas reparticiones y/o direcciones de la provincia con nota de estilo y pruebas fotogrÃ¡ficas y documentales hasta nivel gobernaciÃ³n y MMCC debido a la gravedad de la injusticia y el maltrato sufrido sin tener consideraciÃ³n el hijo que poseo con discapacidad y la edad avanzada de mi padre.\r\n\r\n	Principalmente por la falta de profesionalismo criterio actitud amenazante sin llegar a mencionar los detalles de vestimenta irreglamentaria policial y la negaciÃ³n en todo momento de nombres de los funcionarios pÃºblicos. (policiales y municipales).\r\n \r\n	Por una respuesta favorable les dejo la direcciÃ³n de mail y telÃ©fono personal donde podrÃ© tener una respuesta del presente descargo y solicitando por la misma si existe ordenanza municipal donde prohÃ­be el estacionamiento del lugar (el cual no estÃ¡ informado debidamente y deado).\r\n\r\n	 Lo expuesto y en el caso de existir solicitare formalmente la eximiciÃ³n de zona por la situaciÃ³n especial de mi hijo Francisco y la edad de mi padre.\r\n\r\n	En el caso de no existir ordenanza municipal hacer las denuncias administrativas y judiciales pertinentes.\r\n\r\nMail sergioance@hotmail.com\r\n\r\n\r\n\r\n\r\n					\r\n								Sergio VÃ­ctor Ance\r\n								  DNI 22.751.585\r\n							     Celular 0111561379848\r\n'),
