(624, 'Jimena Vargas', 'jsvargas2003@yahoo.com.ar', 'Consulta', 4, '2015-12-14', '0000-00-00', 'C.A.B.A. 14 de Diciembre de 2015\r\n\r\n\r\nEstimado/a \r\n\r\nLe escribo esta misiva en mi carÃ¡cter de prensa (ad honorem) de la banda de rock LOS ENVIADOS DE THOT.\r\nDesde el aÃ±o 2013 me impuse colaborar con esta banda que tiene como premisa fundamental ser independiente es por esto que todo le cuesta el doble (traslado grabaciÃ³n de disco etc.). \r\nMi cometido apunta a modernizar nuestros eventos tales como aniversarios fiestas nacionales etc. de todo el paÃ­s para que nuestros jÃ³venes puedan vivenciar los shows de esta nueva banda que por motivo de distancia no pueden llegar.\r\nNuestros jÃ³venes tienen que valerse de la tecnologÃ­a para poder seguir la actualidad de dicha banda pero no tienen la oportunidad de verla en vivo.\r\nRecuerdo mi adolescencia y todos los jÃ³venes esperÃ¡bamos el aniversario de la localidad para poder ver bandas en vivo (siendo oriunda del sur del paÃ­s).\r\nTuve la posibilidad de concurrir a varias audiencias con la Secretaria de PolÃ­ticas Socioculturales del Ministerio de Cultura de la NaciÃ³n quienes ya tienen a esta banda en su base de artistas nuevos y me sugirieron que me contacte con las culturas del paÃ­s para comentarles que ya estÃ¡n disponible para solicitarla a la hora de organizar eventos. \r\n\r\nLe pido que los tenga en cuenta para los prÃ³ximos eventos de su localidad.\r\n\r\nSi lo requiere le puedo enviar informaciÃ³n de la banda como ser gacetilla de prensa link de descarga del primer disco â€œAllÃ¡ Arriba Siempreâ€ y del segundo disco â€œRutaâ€ para darle mayor cuantÃ­a a lo solicitado.\r\n\r\n\r\n\r\n\r\nA la espera de una respuesta favorable saludo a usted atentamente.\r\n\r\n\r\n\r\n\r\n\r\nVargas Jimena\r\nCel. (011) 1559601528\r\n'),
