(658, 'Rodrigo', 'baigorria_rodrigo@hotmail.com', 'Proyecto Servicio Ignifugacion ', 4, '2016-01-16', '0000-00-00', 'Memoria  La tragedia de CromaÃ±Ã³n fue un incendio producido la noche del 30 de diciembre de 2004 escimiento ubicado en el barrio de once de la ciudad de Buenos Aires durante un recital de la banda de rock Callejeros. Este incendio provocÃ³ una de las mayores tragedias no naturales en Argentina y dejÃ³ un saldo de 194 muertos y al menos 1432 heridos. Esta tragedia causÃ³ ademÃ¡s importantes cambios polÃ­ticos y culturales.\r\nTodo abrÃ­a sido diferente si el escimiento bailable hubiera contado con el tratamiento ignÃ­fugo en sus instalaciones hoy en dÃ­a tenemos una Ley Nacional que lo esce  Ley NACIONAL 19.587 de Higiene y Seguridad en el Trabajo decreto reglamentario nÂ° 351/1979.\r\nCapÃ­tulo 18\r\nProtecciÃ³n contra Incendios\r\n\r\nCon esta introducciÃ³n paso a ofrecer el servicio\r\nPor medio de la presente es grato dirigirnos a usted enviÃ¡ndoles nuestros mÃ¡s cordiales saludos y a su vez presentarnos. \r\nLuz S.R.L Construcciones y Servicios es una empresa que entre otras cosas esta dedicada a prevenir y evitar el riesgo que implica un incidente con fuego ofreciendo servicios de tratamiento ignÃ­fugo. \r\n\r\nLos servicios que ofrece Luz S.R.L Construcciones y Servicios son\r\n\r\nâ€¢	Tratamiento IgnÃ­fugo por aspersiÃ³n\r\nEste tratamiento consiste en la aplicaciÃ³n de un retardante ignifugo quÃ­mico (liquido) mediante rociado o pulverizaciÃ³n.\r\nEs ideal para aplicar sobre todo tipo de superficies Telones Cortinas Tapizados Alfombras Lonas Maderas Paja CartÃ³n Papel etc.\r\nEstos tratamientos tienen una validez de hasta 1(un) aÃ±o que es el plazo mÃ¡ximo permitido por las autoridades.\r\nâ€¢	Tratamiento Ignifugo por recubrimiento\r\nEste tratamiento consiste en la aplicaciÃ³n de lacas barnices o pinturas ignifugas sobre todo tipos de superficies.\r\nEs ideal aplicar en Pisos Paredes Puertas todo tipo de revestimientos Techos etc.\r\nLos tratamientos por recubrimiento de superficies tiene validez de hasta 5(cinco) aÃ±os que es el plazo mÃ¡ximo permitido por las autoridades \r\nâ€¢	Tratamientos IgnÃ­fugos especiales en Paneles acÃºsticos Carpas EscenografÃ­as Rollos de Tela ECOCUER VinÃ­licos Colchones etc.\r\n\r\nSomos la Ãºnica empresa en tener productos especialmente desarrollados aprobados y certificados por el INTI para este tipo de materiales. \r\n\r\nAsimismo queremos aprove para manifestarle que estamos a su disposiciÃ³n para servirle. Por el motivo estaremos atentos para resolver sus dudas y necesidades.'),
