(689, 'Cecilia Leal', 'cecilialeal@neuroentrenamiento', 'Consulta', 4, '2016-02-11', '0000-00-00', 'Estimados\r\n\r\n \r\nTal como acorde telefÃ³nicamente con la secretarÃ­a privada le envÃ­o en archivo adjunto toda la informaciÃ³n de la campaÃ±a OLIMPIZATE. campaÃ±a que queremos llevar a Catamarca.\r\n\r\nSomos el Instituto Argentino de Voluntariado y trabajamos en conjunto con la AsociaciÃ³n Argentina de Neuroentrenamiento. \r\n\r\nTodo lo referente a la difusiÃ³n de valores olÃ­mpicos lo hacemos de manera GRATUITA.\r\n \r\nLa idea principal es difundir valores olÃ­mpicos  mediante esta campaÃ±a y es fundamental para nosotros que la misma que brindamos de maÃ±era GRATUITA y lo es tambiÃ©n para quienes vienen a capacitarse tenga puntaje docente es por ello que de hacerlo solicitariamos a quien corresponda dicho puntaje.\r\n\r\nEl profesor Sergio Rubino creador de la campaÃ±a y yo prof. Cecilia Leal estaremos llevando OLIMPIZATE a todos los lugares educativos y de formaciÃ³n docente posibles. Escuelas primarias secundarias profesorados de educaciÃ³n fÃ­sica y brindaremos una capacitaciÃ³n docente GRATUITA.\r\n \r\nLa CapacitaciÃ³n cuenta con el apoyo de algunas instituciones  como APAOA NACION APAOA SANTIAGO DEL ESTERO APAOA LA COSTA SUPEF SI.DI.SE entre otras.\r\nPor supuesto que nos encantarÃ­a poder contar con el apoyo de la Secretaria de Deportes de Catamarca.\r\n\r\nSolicitamos el apoyo de su parte para poder llevar esta campaÃ±a que de a poco esta recorriendo la Argentina seria un honor para nosotros contar con su ayuda.\r\nYa que al ser voluntarios todo lo hacemos de manera gratuita.\r\nDesde ya agradezco su buena voluntad y estaremos en permanente contacto.\r\n \r\nAguardare su respuesta y le pido me guie si es que necesita que envÃ­e alguna nota o demÃ¡s.\r\n \r\n \r\nMuchas gracias.\r\n \r\nProf. Cecilia Leal\r\nVOLUNTARIA\r\nNeuronutricion Deportiva\r\nEsp. Dietetica y Nutricion\r\nEsp. Tecnicas de Elongacion'),
