(712, 'Carlos DÃAZ FILGUEIRA', 'carlosdiazfilgueira@yahoo.es', 'Programa radial COMUNIDAD VIAL', 4, '2016-02-25', '0000-00-00', '          Ciudad AutÃ³noma de Buenos Aires 26 de febrero de 2016.\r\n\r\nSeÃ±or Intendente de la \r\nMunicipalidad de SAN FERNANDO DEL VALLE DE CATAMARCA\r\nLic. RaÃºl JALÃL\r\n\r\n          Tengo el agrado de dirigirme a Usted en mi carÃ¡cter de Presidente de la AsociaciÃ³n Civil INSTITUTO SUPERIOR DE PREVENCIÃ“N VIAL  ISPREVI â€“ AsociaciÃ³n 1846278 con PersonerÃ­a JurÃ­dica aprobada el 27 de agosto de 2013 por resoluciÃ³n de la InspecciÃ³n General de Justicia nÃºmero 648 del Ministerio de Justicia y Derechos Humanos de la NaciÃ³n.\r\n         ISPREVI estÃ¡ reconocida por la AGENCIA NACIONAL DE SEGURIDAD VIAL por disposiciÃ³n 266/2014 como instituciÃ³n en el Registro Nacional de Antecedentes en EducaciÃ³n y CapacitaciÃ³n Vial. Conforma ademÃ¡s el COMITÃ‰ CONSULTIVO de dicho organismo.\r\n         Por su parte el suscripto se encuentra asociado a la AsociaciÃ³n de Periodistas de TrÃ¡nsito y Transporte de la Argentina y a la AsociaciÃ³n Argentina de Carreteras.\r\n\r\n         El principal objetivo de ISPREVI es propender a la prevenciÃ³n de riesgos y siniestros en materia vial tendiendo a la mejora continua de la protecciÃ³n de los integrantes de la comunidad vial. \r\n        Por ello y teniendo como lema â€œLa prevenciÃ³n como acciÃ³n culturalâ€ producimos el programa radial â€œCOMUNIDAD VIALâ€ que emitimos por internet por ARINFO PLAY emisora sita en avenida Leandro N. Alem 668 piso 2Âº C.A.B.A. todos los martes de 18 a 19 horas en directo. \r\n        Desde aquÃ­ y con un profundo sentimiento federal tengo el honor de brindarle a Usted y a su equipo nuestro espacio radial para cuanto estime desee comunicar a nuestra audiencia desde esa InstituciÃ³n que conduce respecto a las actividades relacionadas a la seguridad y educaciÃ³n vial. Ruego haga conocer nuestra invitaciÃ³n a los responsables del Ã¡rea de prensa y comunicaciÃ³n y por