(786, 'Aida Canil', 'aidacanil@hotmail.com', 'Denuncia sobre espectÃ¡culos  pÃºblicos (   mÃºsica electrÃ³nica  cuartetos  Ã±peÃ±as etc )  en Club Juventud  Santa Rosa  de Lima  Avenida  Virgen del Valle al 200  entre  Rojas y Almagro  ', 4, '2016-04-23', '0000-00-00', 'SeÃ±or Intendente Me dirijo a Ud para plantearle un grave problema que deben soportar los vecinos que viven en las manzanas comprendidas entre las calles  Caseros Avda Mariano Moreno Rojas y Almagro debido a la siguiente situaciÃ³n        En Avda Virgen del Valle al 200 estÃ¡ situado el Club Juventud Santa Rosa de Lima.   Los fines de semana se realizan espectÃ¡culos pÃºblicos organizados por distintas instituciones y por el mismo Club los que segÃºn InspecciÃ³n General cuentan con la debida autorizaciÃ³n . La mÃºsica que se propaga excede el Ã¡rea de dicho Club tanto cuando el evento se realiza en el salÃ³n cerrado cuanto mÃ¡s aÃºn cuando se realiza en la cancha semi cubierta . La locuciÃ³n y el sonido se expande a un volumen infernal impidiendo hacer una vida domiciliaria normal ( no se puede dialogar en familia ni ver y escu la televisiÃ³n etc ) comenzando esta tortura que hasta hace vibrar los vidrios de las casas desde tempranas horas de la tarde hasta las seis o a veces siete de la maÃ±ana. Al parecer no se realizan controles de ningÃºn tipo por parte de la InspecciÃ³n General por cuanto los espectÃ¡culos se desarrollan con las caracterÃ­sticas antes descriptas . CÃ³mo  puede ser Sr Intendente que se haya dispuesto como excelente medida  el trasladado de  boliches y pub de la Avda  Galindez a la zona noreste de la ciudad salvaguardando la tranquilidad el derecho al descanso y la seguridad de los vecinos de la zona y en procura de una ciudad ejemplar como la que Ud quiere lograr y habiendo trabajado tanto en obras que la embellecieron  la ampliaron la urbanizaron contribuyendo al buen vivir y en contraposiciÃ³n en pleno centro de nuestra ciudad ocurra el descontrol antes mencionado. MÃ¡s aÃºn  corresponde informarle que a la hora de la culminaciÃ³n de los espectÃ¡culos se observan en los alrededores del Club los mÃ¡s lastimosos y vergonzosos hechos productos del exceso de alcohol  habiendo ocurrido una balacea  en un espectÃ¡culo desarrollado en este mes de abril con corridas y disparos de armas por la Avenida hasta frente a la Parroquia Santa Rosa de Lima siendo las 6 hs aproximadamente como  podrÃ­amos testimoniar varios vecinos.            Sr. Intendente admiro su gestiÃ³n  su gran capacidad de trabajo y los objetivos que dÃ­a a dÃ­a se logran por el mejoramiento de la vida ciudadana. ConfÃ­o en esta oportunidad que Ud. podrÃ¡ intervenir de la mejor manera para solucionarnos este problema. Seguramente que el Consejo Deliberante tambiÃ©n tendrÃ¡ que revisar las Ordenanzas que contemplen estas actividades desbordadoras del orden y la tranquilidad urbana. Muchas gracias desde ya por su atenciÃ³n y por lo que pueda realizar en procura de buscar una soluciÃ³n . Lo saludo muy atentamente.                      Aida Canil  Avda Virgen del Valle 257                                                     '),
