(801, 'Juan JosÃ© Chumbita', 'juananalisis@hotmail.com', 'Problemas en un pasaje', 4, '2016-05-02', '0000-00-00', 'Estimados operadores del centro de atenciÃ³n al ciudadano. No sabrÃ­a a quien dirigir mi reclamo ya que estoy teniendo problemas en el pasaje donde vivo y no se quien es el encargado en estos casos. El hecho es que mis vecinos circulan en sus vehÃ­culos particulares (Autos y camionetas) por el pasaje de frente de mi casa y debido al peso de los mismos la caja donde estÃ¡ la llave de paso de agua de mi domicilio se rompe pasando un mes y aveces todos los meses he pedido a la empresa aguas de Catamarca si podÃ­a colocar una caja de acero en el lugar ya que la de plÃ¡stico no resiste mucho tiempo y es un gasto constante comprar los materiales y pagar mano de obra para refaccionar el daÃ±o causado por los rodados no tuve una respuesta favorable ya que las cajas de acero fueron eliminadas de las instalaciones y ahora solo utilizan el plÃ¡stico. Mi preguntas son  Â¿estos pasajes fueron diseÃ±ados para que circulen vehÃ­culos si asÃ­ fuera Â¿Como podre solucionar este problema de no ser asÃ­Â¿La Municipalidad de la provincia podrÃ­a colocar algunas barreras de contenciÃ³n para que los vehÃ­culos no ingresen al pasaje (como se hizo en el pasaje del barrio libertador segundo al lado de la casa 48) Y por ultimo si a Uds. no les toca cumplir con dicha responsabilidad Â¿a quien debo recurrir\r\nMuchas gracias por el espacio y por leer mi problemÃ¡tica.\r\nAtte. Chumbita Juan JosÃ©. \r\nVecino del barrio Instituto Casa nÂ° 21 Pasaje Gobernador AcuÃ±a entre La Pampa (ex Lavalle) y San Luis (ex Conesa) a la altura de la calle Gobernador AcuÃ±a (ex Pueyrredon)');
