(1085, 'barrionuevo daniel', 'daniiell@hotmail.com.ar', 'policia de transito', 3, '2016-11-13', '0000-00-00', 'Hola quisiera hacer un reclamo a la policia de transito ya que no dejan dormir de viernes a domingos cuando llega los fines de semana se me hace un infierno en mi casa en los regionales y santa fe tengo dos nenas una recien nacida no se pueden imaginar que mi bb no puede dormir de todo el ruido molesto que hacen se ponen a gritar hablar fuerte risas fuertes aveces la camioneta con musica fuerte y eso no es todo aveces me tiran botellas de cerveza en mi planta de la calle por favor asta malas palabras tiene que escu mi hija de 5 aÃ±os siempre de viernes a domingo de las 2200 asta las 100 de la maÃ±ana se ponen a gritar es insopor ya me canse de reclamar y no pasa nada espero que me puedan solucionar no quiero llegar a mayores tenia pensado sacar foto y videos y subir a las redes sociales pero no los quiero escra por favor espero su solucion rapida he imediata'),
