(1091, 'Hector Acosta', 'lemaliel@hotmail.com', 'error en pagina', 0, '2016-11-16', '2020-05-08', 'buenas tardes \r\n\r\nen los ultimo dias he intentado presentar la ddjj mensual cont comercial de los clientes que tengo a cargo en el estudio. pero me sale un error al presionar el boton de rentas. No se puede acceder a este sitio web\r\n\r\nNo se ha podido encontrar la direcciÃ³n DNS del servidor de www.sfvcrentas.gob.ar.\r\nDNS_PROBE_FINISHED_NXDOMAIN\r\n\r\n\r\nhe renovado el ip de la maquina pero me resulta imposible es mas probe desde otra maquina en otro lugar y sale el mismo error \r\npor favor vean de que se trata para poder presentar la ddjj desde ya les agradesco \r\ncordiales saludos '),
