(1095, 'Marcelo Cisternas', 'marcecisternas.mc@gmail.com', 'PORTAL DEL NORTE', 4, '2016-11-18', '0000-00-00', 'Buenas..soy el presidente del CV Portal del Norte.\r\nMi inquietud es la siguiente cuando comenzaran a trabajar para culminar las obras en el loteo Portal del Norte\r\nHoy en dia ya hace 3 aÃ±os y 3 meses que compre mi terreno el aÃ±o pasado comenzamos en la organizacion de un CV para ver si por este medio podiamos conseguir avances en la obra pero parece que es inutil. Los vecinos del Portal (alrededor de 1200 familias) lo unico que pedimos es que nos den lo que firmamos por contrato (boleto compraventa que se realizo ante escribano publico nacional el cual se acordaba un plazo maximo de 18 meses para la realizacion y culminacion de las obras de servicios y urbanizacion plazo que ya fue ampliamente superado) y para lo cual se nos pidio abonar lo que hicimos en tiempo y forma estipulados.\r\nPara darle un panorama la obra de Energia se encuentra abandonada desde hace 2 o 3 meses aproximadamente y la situacion actual es luz de obra que es generado por 3 generadores rurales. El cableado y colocacion de postes no ha sido terminado aun. En lo compete a la obra de agua y cloaca si bien las caÃ±erias de agua estan puestas en su totalidad presentan diversas perdidas que han provocado hasta hundimiento de calle. Yo he ido avisando de dichas perdidas las cuales no fueron reparadas ya que lo solucionaban mermando la presion de agua y afectando a las construccion de mas de 70 viviendas que se estan realizando en el Portal y como si fuera poco debido a las perdidas no reparadas la empresa Aguas de Catamarca S.A.P.E.M. disminuyo la presion al loteo lo que nos afecta muchisimo a los vecinos que con el sacrificio diario estamos haciendo la construccion de nuestro hogar. En las obras de cloacas ya fueron colocados los caÃ±os en su totalidad y comenzaron la obra de bocas de inspeccion pero las mismas se dejaron de hacer (a pesar que la obra ya fue pagada a una empresa privada superando los 4.000.000 segun palabras del sr. Intendente). Falta la obra que unira el servicio de cloacas con la av Choya y la urbanizacion (que consta de cordones cunetas canalizacion del arroyo que se encuentra en av. Sagrada Familia y la habilitacion de las manzanas H e I que estan totalmente inaccesibles e inhabis ya que estan afectadas por un gran declive que las transforma literalmente en un barranco).\r\nEsta es la realidad que estamos padeciendo desde hace mucho tiempo. Tanto los vecinos como la comision del Cv nos sentimos superados por esta situacion vemos en los medios como inauguran obras y a nosotros nos siguen haciendo de lado. Pedimos una solucion y que sea urgente. En el dia de hoy hicimos una consulta por medio de un grupo de Whatsapp que tenemos con el sr intendente y con sus funcionarios a la cual no recibimos respuesta alguna.\r\nHa espera una de respuesta coherente y positiva los saludo atte. '),
