 TORNA PROPENSO A LA ACTIVIDAD DELICTIVA es por ello la importancia del aspecto geogrÃ¡fico en la lucha contra el delito.\r\n\r\n          Lo insto a realizar un reconocimiento e inspecciÃ³n del lugar al que hago referencia y disponer las medidas pertinentes (limpieza mantenimiento y por quÃ© no un cercado del lugar) bajo apercibiento de iniciar acciones legales en contra del municipio por los daÃ±os y perjuicios al medio ambiente que genera su falta de regulaciÃ³n en la materia y porque nos urge y hablo en representaciÃ³n de todos los vecinos una pronta ejecuciÃ³n y soluciÃ³n del tema.\r\n\r\n           Aguardo su pronta respuesta sobre todo porque soy un vecino que paga de manera regular y activa el impuesto al alumbrado barrido y limpieza de nuestro barrio. \r\n\r\n           Agradezco desde ya la atenciÃ³n a mi solicitud.\r\n'),
