(1405, 'Diego Luna Avellaneda', 'dclunavellaneda@gmail.com', 'Por Plan de asfaltado de MayoÂ´17 a MayoÂ´18', 4, '2017-06-05', '0000-00-00', 'SeÃ±or Intendente\r\nQuien suscribe Presidente del Centro Vecinal Comunidad en Movimiento (c/PersonerÃ­a en TrÃ¡mite) con sede en el BARRIO CGT (50 vv. SUR) se dirige a Ud. con el objeto de expresar la siguiente inquietud y malestar de nuestros vecinos de la comunidad mencionada. \r\nResulta que el dÃ­a 09/05/2017 en horas de la tarde tuvimos una reuniÃ³n (en su despacho) con el Dr. HernÃ¡n Martel y el Sr. Denis Zannazzi  especÃ­ficamente por el tema Asfaltado de Nuestro Barrio (ese dÃ­a ingresamos una segunda Nota al respecto). En la mencionada reuniÃ³n luego de expresar todas nuestras inquietudes al respecto el Secretario de Gobierno nos mencionÃ³ que usted nos tuvo consideraciÃ³n por todos los reclamos realizados de parte nuestra (despuÃ©s de 20 aÃ±os) y porque ya estaba comprometido dentro de su agenda nos asegurÃ³ que el asfaltado de nuestro barrio estaba incluido dentro del Plan de Asfaltado de MayoÂ´17 a MayoÂ´18 que estaba por darse a conocer en los prÃ³ximos dÃ­as..  Muy grata fue la noticia cuando escuchamos esa informaciÃ³n de propia boca de su Secretario de Gobierno.. y esa misma noche les comunicamos a los vecinos.. los que aplaudieron su gestiÃ³n y demÃ¡s.. \r\nLamenmente toda esa alegrÃ­a se viÃ³ empaÃ±ada a las 24 hs.. de la mencionada reuniÃ³n dado a que al dÃ­a siguiente se diÃ³ a conocer el Plan de Asfaltado mencionado y en el mismo no nos encontramos nunca.. seguramente habrÃ¡ sido un error de tipÃ©o..\r\nEn virtud de esto querÃ­a solicitar quiera tener a bien nos confirme de manera oficial la inclusiÃ³n de nuestro barrio en el mencionado Plan (incluso hasta le propongo realizar una reuniÃ³n barrial en la que usted personalmente pueda brindar el mencionado anuncio.. una Gran Noticia para nuestra comunidad barrial)..\r\nEsperando buenas nuevas respecto al tema de menciÃ³n lo saludo con el mayor respeto.\r\n\r\nDiego C. Luna Avellaneda\r\n    DNI 24.981.642\r\n   cel. 03834655182 '),
