iÃ©ramos informaciÃ³n acerca de presentar nuestro proyecto u optar a cargo  en nuestras Ã¡reas porque quizÃ¡s exista la necesidad de especialistas en mÃºsica  y asÃ­ contribuir al fortalecimiento expansiÃ³n y crecimiento de sus extraordinarias instituciones.\r\n\r\nLe aseguramos quÃ© de ser positiva la solicitud tendrÃ¡ dos aliados y leales profesionales responsables para fortalecer de manera extraordinaria el proyecto musical tan maravilloso en la naciÃ³n Argentina.\r\n\r\nDe requerirlo y segÃºn su solicitud enviaremos nuestros CV para su evaluaciÃ³n por lo demÃ¡s estÃ¡ decir quÃ© estaremos atentos a cualquier respuesta relacionada a nuestra solicitud y a su orden.\r\n\r\nAtte\r\nProf. JesÃºs BriceÃ±o Barrios\r\nProf. Milenna Riera Leal\r\nFundaciÃ³n musical SimÃ³n BolÃ­var (Ã³rgano rector para el sistema nacional de coros y orquestas juveniles e infantiles de Venezuela)\r\nTelf 58 212.816.03.71/ 58 426.370.14.40\r\nemails\r\njesus_br633@hotmail.com/ milennarleal@gmail.com \r\njebriceno@fundamusical.org.ve'),
