(1519, 'Ariel Eidelson', 'aridlsn@gmail.com', 'Empleo personas con Discapacidad', 4, '2017-08-22', '0000-00-00', 'Lic. RaÃºl Alejandro Jalil\r\nMi nombre es Ariel Eidelson soy una persona responsable empatica y emprendedora y con vocacion de servicio pero poseo certificado nacional de discapacidad motora lo que virtualmente me excluye de las busquedas laborales privadas. \r\nTengo experiencia laboral en el area de compras y en turismo pero tambien poseo solida experiencia de jardineria y paisajismo adquiridos por hobby.\r\nSoy activista y militante del cannabis medicinal reconocido a nivel nacional por mis conocimientos de cultivo estandarizado y de extracciones de aceite midicinal con amplias y comprobantes referencias.\r\nCreo poder desarrollar actividades que van desde lo administrativo hasta lo productivo sin mayor inconveniente (no puedo levantar peso). Poseo regustro de conducir al dia hablo ingles y hebreo y tengo solidos conocimientos de informatica tanto de sfto como de hardware.\r\nTengo disponibilidad inmediata y posibilidad viajar.\r\nEspero poder entrevistarme con Ud. y ser poder tenido en cuenta para trabajar para el municipio.\r\nDesde ya le agradezco mucho \r\nAtte \r\nAriel Eidelson\r\naridlsn@gmail.com'),
(1520, 'Fernando Mendizabal', 'fmendi0412@hotmail.com', 'BUROCRACIA responsable de faltas', 3, '2017-08-23', '0000-00-00', 'Mi hijo cumplio los 17 aÃ±os el pasado 17 de Agosto. Aprovecho sus vacaciones de Julio para hacer y rendir el curso. El pasado 17 y con toda su ilusiÃ³n  todos los papeles en orden fue a hacer su carnet en horario vespertino ya que cursa sus estudios secundarios en horario matutino. Muy grande fue su frustacion al recibir la negativa ya que la constancia del curso debÃ­a retirarla x la maÃ±ana ya que en ese horario habÃ­a realizado el curso. Al dia siguiente mi esposa fue a retirar dicha constancia en horario matinal para que el pueda a la tarde retirar su licencia. La respuesta fue que es personal y como Ãºnica opciÃ³n le dieron que falte a la escuela. Actitudes burocrÃ¡ticas como esta solo incentivan a que la gente no obtenga como corresponda su licencia correspondiente o busque alternativas ilegales para hacerlo. Hacer perder un dia de su ciclo lectivo a una persona solo por un obstÃ¡culo burocratico solo demuestra que nuestra ciudad y nuestra provincia solo siguen siendo el ultimo escalon en eficiencia. UNA LASTIMA.'),
